import MessageBox from './messageBox';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function ChatApp() {
    return (
        <Container>
        <Row>
          <Col>
            <div>
              <p>I am a message box</p>
            </div>
          </Col>
          <Col>
            <MessageBox />
          </Col>
        </Row>
      </Container>
    );
}

export default ChatApp
